--
-- Table structure for table `person`
--

DROP TABLE IF EXISTS `person`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `person` (
  `pid` int(11) NOT NULL AUTO_INCREMENT COMMENT '人员编号',
  `ptype` int(11) DEFAULT NULL COMMENT '类型16~18',
  `cardid` varchar(20) DEFAULT NULL COMMENT '身份证',
  `name` varchar(10) DEFAULT NULL COMMENT '姓名',
  `sname` varchar(10) DEFAULT NULL COMMENT '绰号',
  `birthday` datetime DEFAULT NULL,
  `gender` tinyint(1) DEFAULT NULL COMMENT '性别',
  `education` int(11) DEFAULT NULL COMMENT '教育程度1~9',
  `addr` varchar(100) DEFAULT NULL COMMENT '家庭住址',
  `job` varchar(45) DEFAULT NULL COMMENT '职业',
  `tel` varchar(20) DEFAULT NULL COMMENT '联系电话',
  `phone` varchar(20) DEFAULT NULL COMMENT '手机号码',
  `wplace` varchar(45) DEFAULT NULL COMMENT '工作地点',
  `spec` varchar(45) DEFAULT NULL COMMENT '专业特长',
  `incomesource` varchar(45) DEFAULT NULL COMMENT '收入来源',
  `political` int(11) DEFAULT NULL COMMENT '政治面貌',
  `relationid` int(11) DEFAULT NULL COMMENT '与户主关系',
  `picture` varchar(100) DEFAULT NULL COMMENT '照片',
  `villageid` int(11) DEFAULT NULL COMMENT '所属村编号',
  `ethnic` varchar(10) DEFAULT NULL COMMENT '民族',
  `army` varchar(20) DEFAULT NULL COMMENT '兵役状况',
  `marriageid` int(11) DEFAULT NULL COMMENT '婚姻状况10~13',
  `residentid` int(11) DEFAULT NULL COMMENT '户口性质14,15',
  `health` varchar(20) DEFAULT NULL COMMENT '身体状况',
  `yearincome` int(11) DEFAULT NULL COMMENT '年收入',
  `memo` varchar(100) DEFAULT NULL COMMENT '其他',
  `position` int(11) DEFAULT NULL COMMENT '职务',
  `social` int(11) DEFAULT NULL COMMENT '社会身份',
  `islowsafe` tinyint(1) DEFAULT NULL COMMENT '是否低保',
  `isaddsafe` tinyint(1) DEFAULT NULL COMMENT '是否参保',
  `iscorps` tinyint(1) DEFAULT NULL COMMENT '是否军属',
  `isout` tinyint(1) DEFAULT NULL COMMENT '是否外出',
  `isoversea` tinyint(1) DEFAULT NULL COMMENT '是否华侨',
  `height` float DEFAULT NULL COMMENT '身高',
  `diffcond` varchar(100) DEFAULT NULL COMMENT '困难情况',
  `companyname` varchar(50) DEFAULT NULL COMMENT '外出工作单位',
  `currentaddress` varchar(100) DEFAULT NULL COMMENT '现在住址',
  `lastupdatetime` datetime DEFAULT NULL,
  PRIMARY KEY (`pid`),
  KEY `relation_to_host_idx` (`relationid`),
  KEY `village_idx` (`villageid`),
  KEY `education_idx` (`education`),
  KEY `position_idx` (`position`),
  KEY `political_idx` (`political`),
  KEY `social_idx` (`social`),
  KEY `marriage_idx` (`marriageid`),
  KEY `mobility_idx` (`ptype`),
  KEY `resident_idx` (`residentid`),
  CONSTRAINT `relation-to-host` FOREIGN KEY (`relationid`) REFERENCES `type_relation` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `education` FOREIGN KEY (`education`) REFERENCES `type_common` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `marriage` FOREIGN KEY (`marriageid`) REFERENCES `type_common` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `mobility` FOREIGN KEY (`ptype`) REFERENCES `type_common` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `political` FOREIGN KEY (`political`) REFERENCES `type_political` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `position` FOREIGN KEY (`position`) REFERENCES `type_position` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `resident` FOREIGN KEY (`residentid`) REFERENCES `type_common` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `social` FOREIGN KEY (`social`) REFERENCES `type_social` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `village` FOREIGN KEY (`villageid`) REFERENCES `village` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=1188 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

